import React from 'react'
import { Link } from 'react-router-dom'
import './nav.css'

export default function MainNavigation() {
    return (
        <header>
            <nav>
                <h2 id='title'>React Meetups</h2>
                <ul>
                    <li>
                        <Link 
                            style={{
                                color: '#fff', 
                                textDecoration: 'none'
                                }} 
                            to='/'>All Meetups</Link>
                    </li>
                    <li>
                        <Link 
                            style={{
                                color: '#fff', 
                                textDecoration: 'none'
                                }} 
                            to='/new-meetup'>New Meetups</Link>
                    </li>
                    <li>
                        <Link 
                            style={{
                                color: '#fff', 
                                textDecoration: 'none'
                                }} 
                            to='/favourites'>Favourites</Link>
                    </li>
                </ul>
                <div style={{clear: 'both'}}></div>
            </nav>
        </header>
    )
};
